import React, { useEffect } from "react";
import HeroSection from "./components/HeroSection";
import ViewCourse from "./ViewCourse";
import AddCourse from "./AddCourse";
function Home() {
  useEffect(() => {
    document.title = "Home Page";
  }, []);
  return (
    <>
      <HeroSection />
      <div className="homesection"> 
      <ViewCourse />
      <AddCourse />
      </div>
    </>
  );
}
export default Home;
